import {BrowserRouter as Router, Route, Routes} from 'react-router-dom'
import Voting from '../src/pages/Voting'
import { useState, useEffect } from 'react'
function App() {
  return (
  <Router>
    <h1>Home</h1>
    <Routes>
      <Route path='/voting' element={ <Voting/> }/>
    </Routes>
  </Router>
  );
}

export default App;
